script: |
  super -f tsv -I q8632.sql | sort > q8632.out

inputs:
  - name: q8632.sql
    data: |
      SELECT DISTINCT - MIN ( - col0 ) * 79 + CAST ( - COUNT ( ALL + - CAST ( + 66 AS INTEGER ) ) AS INTEGER ) + + SUM ( DISTINCT - + col0 ) AS col0 FROM tab1 AS cor0;
  - name: tab1

outputs:
  - name: q8632.out
    data: |
      6959
